//FUNCTIONS
function mannKendall(arr) {
  const n = arr.length;
  let s = 0;
  let tau = 0;
  let varS = 0

  // Loop through the array, calculating the intermediate values needed for the test
  for (let i = 0; i < n - 1; i++) {
    for (let j = i + 1; j < n; j++) {
      s += Math.sign(arr[j] - arr[i]);
      varS += (j - i) * (j - i - 1) * (2 * j + 1 - i) / 18;
    }
  }

  // Calculate the final values needed for the test
  tau = s / Math.sqrt((n * (n - 1) * (2 * n + 1)) / 18);

  return tau
}

