//Orestein-Uhlenbeck Process with Least Squares Regression to estimate parameters
function ornsteinUhlenbeck(data) {
  // Initialize the time array
  let time = [];
  for (let i = 0; i < data.length; i++) {
    time.push(i);
  }

  // Estimate the parameters using least squares regression
  let X = [];
  for (let i = 0; i < time.length; i++) {
    X.push([1, time[i], time[i] * time[i], time[i] * time[i] * time[i]]);
  }
  let Y = data;
  let X_transpose = math.transpose(X);
  let params = math.multiply(math.inv(math.multiply(X_transpose, X)), math.multiply(X_transpose, Y));

  // Extract the parameters from the least squares fit
  let x0 = params[0]
  let theta = params[1];
  let mu = params[2];
  let sigma = params[3];

  // Return an object containing the parameters, t-value, and p-value
  return {
    params: {
      x0: x0,
      theta: theta,
      mu: mu,
      sigma: sigma
