  let normalizedData = variable.srcArray.map(val => (val - mean) / std);

  // Parameters for the algorithm
  let m = 3; // initial embedding dimension
  let tau = 1; // initial time delay
  let windowSize = 10; // rolling window size

  let N = normalizedData.length;
  let d = new Array(N - (m - 1) * tau);

  // Calculating distance
  for (let i = 0; i < d.length; i++) {
    let x = normalizedData.slice(i, i + (m - 1) * tau);
    let y = normalizedData.slice(i + tau, i + (m - 1) * tau + tau);
    d[i] = math.norm(math.subtract(x, y));
  }

  let threshold;
  // Adaptive loop to determine threshold, tau and m
  for (let i = 0; i < d.length; i++) {
    let subarray = d.slice(Math.max(i - windowSize, 0), i);
    let mean_distance, std_distance, cv;
    if (subarray.length === 0) {
      mean_distance = 0;
      std_distance = 0;
      cv = 0;

    } else {
      mean_distance = math.mean(subarray);
      std_distance = math.std(subarray);
      cv = (std_distance / mean_distance) * 100;
    }
    threshold = mean_distance + cv;

    // Adding +1 to tau and m
    for (let j = windowSize; j < N; j++) {
      let std_distance = math.std(d.slice(j - windowSize, j));
      if (std_distance > threshold) {
        tau++;
        m++;
        if (N - (m - 1) * tau < 1) {
          // Handle the case where N is less than 1 (for example, by breaking out of the loop)
          break;
        } else {
          d = new Array(N - (m - 1) * tau);
        }
        N = d.length

        // Recalculate distance
