          let x = normalizedData.slice(k, k + (m - 1) * tau);
          let y = normalizedData.slice(k + tau - 1, k + (m - 1) * tau + tau - 1);

          d[k] = math.norm(math.subtract(x, y));
        }
      }
    }
  }

  // Calculate the Lyapunov exponent
  variable.lyapunovExponent = math.divide(math.log(math.mean(d)), tau);
}


